import React,{ useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  useEffect( () => {
    axios.get('/todos')
      .then(res => {
        console.log(res)
      })
      .catch(err => {
        console.log(err)
      },[])

  })
  return (
    <div className="App">
        <p> Hello </p>
    </div>
  );
}

export default App;
